window.bookSummaryJSON = "<p><b>From a master of comedy and fantasy comes the long-awaited audiobook, </b><b><i>The Land: Alliances</i></b><b>.&nbsp;</b></p> <p><b>You can now bring adventure and wonder with you wherever you go. Aleron Kong, the Father of American LitRPG, has sculpted a world of joy, horror, and wonder, forging together the best elements of American LitRPG. Quests, mystery, action, and adventure spill forth with every word.</b></p> <p><b>Paired with the immeasurable talent of Nick Podehl, the best audio performer currently working, this third volume continues to deliver a unique experience that will delight fantasy fans of all ages.</b></p> <p>The acclaimed third novel of the best-selling LitRPG saga, Chaos Seeds, from the Father of American LitRPG, Aleron Kong. Number one in cyberpunk and video game fantasy with over <i>10,000</i> positive reviews!</p> <p>Richter and Sion are in a fight for their very lives. Their enemies are circling and the powers they have awakened are barely under their control.</p> <p>Death and war are on their doorstep, but they have a simple message for the enemies of the Mist Village.</p> <p>\"Kiss your loved ones goodbye. The Mist will claim you.\"</p> <p>A wonderful blend of humor and adventure, <i>The Land: Alliances</i> will transport you to the world of your dreams...and your nightmares.&nbsp;</p>"; 
